export default function GeneratePage() {
  const [formData, setFormData] = useState({
    prompt: "",
    negative_prompt: "",
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    console.log("Prompt:", formData.prompt);
    console.log("Negative Prompt:", formData.negative_prompt);
    // Burada form verilerini istediğiniz gibi işleyebilirsiniz
  };
  return (
    <div className="min-h-screen flex items-center justify-center bg-gray-100">
      <form
        onSubmit={handleSubmit}
        className="bg-white p-6 rounded-lg shadow-md w-full max-w-md"
      >
        <h2 className="text-2xl font-bold mb-4 text-center">
          Text to Image Form
        </h2>

        {/* Prompt Alanı */}
        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="prompt"
          >
            Prompt
          </label>
          <input
            type="text"
            id="prompt"
            name="prompt"
            value={formData.prompt}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Enter your prompt"
          />
        </div>

        {/* Negative Prompt Alanı */}
        <div className="mb-4">
          <label
            className="block text-gray-700 text-sm font-bold mb-2"
            htmlFor="negative_prompt"
          >
            Negative Prompt
          </label>
          <input
            type="text"
            id="negative_prompt"
            name="negative_prompt"
            value={formData.negative_prompt}
            onChange={handleChange}
            className="w-full px-3 py-2 border rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
            placeholder="Enter your negative prompt"
          />
        </div>

        {/* Submit Butonu */}
        <div className="flex items-center justify-between">
          <button
            type="submit"
            className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded-lg focus:outline-none focus:ring-2 focus:ring-blue-500"
          >
            Generate Image
          </button>
        </div>
      </form>
    </div>
  );
}
